import React, { useState } from 'react';
import { fetchDriverResults } from '../api/api';

const GrandPrixDetails = ({ grandPrix, onGoBack }) => {
  const [expandedSession, setExpandedSession] = useState(null);
  const [driverResults, setDriverResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleSessionClick = async (sessionType) => {
    if (expandedSession === sessionType) {
      setExpandedSession(null);
    } else {
      setExpandedSession(sessionType);
      setLoading(true);
      setError(null);

      try {
        const results = await fetchDriverResults(grandPrix.name, sessionType);
        setDriverResults(results);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    }
  };

  const isRaceSession = expandedSession === 'Grand Prix';
  const isSprintRace = expandedSession === 'Sprint';
  const isQualificationSession = expandedSession === 'Qualifying';
  const isSprintQualificationSession = expandedSession === 'Sprint Qualifying';

  return (
    <div className="bg-white rounded-xl shadow-md p-6">
      <div className="flex justify-between items-center mb-6">
        <h2 className="text-2xl font-bold text-gray-800">{grandPrix.name}</h2>
        <button
          onClick={onGoBack}
          className="bg-gray-200 hover:bg-gray-300 text-gray-800 py-2 px-4 rounded-lg transition-colors"
        >
          ← Go back
        </button>
      </div>

      <div className="space-y-4">
        {grandPrix.events.map((event, index) => (
          <div key={index} className="border border-gray-200 rounded-lg overflow-hidden">
            <button
              onClick={() => handleSessionClick(event.type)}
              className="w-full bg-blue-600 hover:bg-blue-700 text-white font-medium py-3 px-4 text-left flex justify-between items-center transition-colors"
            >
              <span>
                {event.type}: {event.date} at {event.time}
              </span>
              <span>{expandedSession === event.type ? '▲' : '▼'}</span>
            </button>

            {expandedSession === event.type && (
              <div className="p-4 bg-gray-50">
                {loading ? (
                  <p className="text-center text-gray-500">Loading...</p>
                ) : error ? (
                  <p className="text-red-500">Error: {error}</p>
                ) : driverResults.length > 0 ? (
                  <div className="overflow-x-auto">
                  <table className="min-w-full bg-white">
                    <thead className="bg-gray-700 text-white">
                      <tr>
                        <th className="py-2 px-3 text-left">Pos</th>
                        <th className="py-2 px-3 text-left">No</th>
                        <th className="py-2 px-3 text-left">Driver</th>
                        <th className="py-2 px-3 text-left">Car</th>

                        {/* Conditional columns for different session types */}
                        {isQualificationSession || isSprintQualificationSession ? (
                          <>
                            <th className="py-2 px-3 text-left">Q1</th>
                            <th className="py-2 px-3 text-left">Q2</th>
                            <th className="py-2 px-3 text-left">Q3</th>
                          </>
                        ) : isRaceSession ? (
                          <>
                            <th className="py-2 px-3 text-left">Time</th>
                            <th className="py-2 px-3 text-left">Gap</th>
                            <th className="py-2 px-3 text-left">Laps</th>
                            <th className="py-2 px-3 text-left">Points</th>
                          </>
                        ) : isSprintRace ? (
                          <>
                            <th className="py-2 px-3 text-left">Time</th>
                            <th className="py-2 px-3 text-left">Gap</th>
                            <th className="py-2 px-3 text-left">Points</th>
                          </>
                        ) : (
                          // Default for Practice sessions
                          <>
                            <th className="py-2 px-3 text-left">Time</th>
                            <th className="py-2 px-3 text-left">Gap</th>
                            <th className="py-2 px-3 text-left">Laps</th>
                          </>
                        )}
                      </tr>
                    </thead>

                    <tbody className="divide-y divide-gray-200">
                      {driverResults.map((result, idx) => (
                        <tr key={idx} className="hover:bg-gray-50">
                          <td className="py-2 px-3">{result.pos || '-'}</td>
                          <td className="py-2 px-3">{result.no || '-'}</td>
                          <td className="py-2 px-3">{result.driver || '-'}</td>
                          <td className="py-2 px-3">{result.car || '-'}</td>

                          {/* Conditional data cells */}
                          {isQualificationSession || isSprintQualificationSession ? (
                            <>
                              <td className="py-2 px-3">{result.q1 || '-'}</td>
                              <td className="py-2 px-3">{result.q2 || '-'}</td>
                              <td className="py-2 px-3">{result.q3 || '-'}</td>
                            </>
                          ) : isRaceSession ? (
                            <>
                              <td className="py-2 px-3">{result.time || '-'}</td>
                              <td className="py-2 px-3">{result.gap || '-'}</td>
                              <td className="py-2 px-3">{result.laps || '-'}</td>
                              <td className="py-2 px-3">{result.points || '-'}</td>
                            </>
                          ) : isSprintRace ? (
                            <>
                              <td className="py-2 px-3">{result.time || '-'}</td>
                              <td className="py-2 px-3">{result.gap || '-'}</td>
                              <td className="py-2 px-3">{result.points || '-'}</td>
                            </>
                          ) : (
                            // Default for Practice sessions
                            <>
                              <td className="py-2 px-3">{result.time || '-'}</td>
                              <td className="py-2 px-3">{result.gap || '-'}</td>
                              <td className="py-2 px-3">{result.laps || '-'}</td>
                            </>
                          )}
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
                ) : (
                  <p className="text-gray-500 italic">No data available for this session.</p>
                )}
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default GrandPrixDetails;
